import Logo from "./images/Logo.png"

const Navbar = () => {
    return (
      <nav className="Navbar">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/gigs">Gigs</Link>
        <img src={Logo}></img>
      </nav>
    );
  };
  
  export default Navbar;
